// click event to go to cart ///////////////////////////////////////////////////////
$("#gotocart").on("click", () => {
    // hiding the row onw by hide()////////////////////////////
    $("#row-1").addClass("hide");
    $("#gotocart").hide();
    $(".paybtn").show();

    $("#row-2").append('<h1 id="cartheading">cart</h1>')
    let heading = $('<div class="col-lg-12"><button class="paybtn shadow" id = "propay">proceed to pay</button></div>')
    $("#row-2").append(heading)

    $("#propay").on("click", () => {
        propay();

    });

    // looping to create element that are added to cart/////////////////////////////
    for (let i = 0; i < idarr.length; i++) {
        //    creating elements to bootstrap card

        // main div for card 
        let carddiv = $("<div class='card col-lg-2 my-1 p-3' id='maincarddiv'></div>")
        $("#row-2").append(carddiv);
        $("#cartheading").addClass("show")
        // img tag for card 
        let imgtag = $("<img>")
        $("img").addClass("card-img-top");
        carddiv.append(imgtag);
        imgtag.attr("src", items[idarr[i]].img)
        // creating the body of the card 
        let cardbody = $("<div>")
        carddiv.append(cardbody);
        $(cardbody).addClass("card-body");
        // creating the paragraph to the card (name of the item)//
        let cardp = $("<h5 class = 'text-capitalize'>")
        cardbody.append(cardp)
        // creatin the price of the item 
        let cardprice = $(`<h6 id='${items[i].id}'>`)
        cardprice.addClass("price");
        let price = items[idarr[i]].amount;
        $(cardprice).text(price)
        cardbody.append(cardprice)
        let tittlep = items[idarr[i]].titile;
        // append the card titile to the card body 
        $(cardp).text(tittlep);
        // create a add to cart button 
        btncard = $(`<button id = ${items[i].id}>pay now</button>`)
        $(btncard).addClass("btn btn-primary")

        cardbody.append(btncard)
        // creating the input box and append to the card body  
        let inputcard = $(`<input type='number' id=${items[i].id} class = 'form-control my-2'>`)
        $(inputcard).attr("value", `${invaluearr[i]}`)
        $(cardp).append(inputcard);


        // calc part 
        
    }
})


